import './App.css';
import Header from './Header';
import {SubHeader} from './Header';
import { Starter, Greetings, Introduction } from './components/Greetings';

function App() {
  const dateOfBirth = "1st September, 1996"

  return (
    <div className="App">
      <Starter/>
      <Greetings/>
      <Introduction/>
      <Header/>
      <SubHeader/>
      <h1 i='Name'>Md Jahid Hasan</h1>
      <h2 className='Profession'>Front End Developer</h2>
      <h3 className='dateOfBirth'>{dateOfBirth}</h3>
    </div>
  );
}

export default App;
